import React from 'react'

function Display({apiData}) {
    return (
        <div className="display">   
            {apiData.length > 0 &&
            apiData.map((photo, index) => (
            <div className="row-list" onClick={getPopUpData(index)} key={index}>
                <img className="img"  src={photo.urls.thumb}></img>
            </div> ))}
        </div> 
    )
}

export default Display
